let scripts = document.getElementsByTagName('script');
let lang = scripts[scripts.length-1].src.replace(/^.*\?lang=/,'');
let head = document.getElementsByTagName('head').item(0);
let script = document.createElement('script');
script.setAttribute('type', 'text/javascript');
script.setAttribute('src', 'https://api-maps.yandex.ru/2.1/?lang='+lang);
head.appendChild(script);
let link;
function init() {
  let urlButton = 'data:image/svg+xml;base64,';
  let iconPoint = 'data:image/svg+xml;base64,';
  let iconPlacemark = 'data:image/svg+xml;base64,';
  let iconCluster = 'data:image/svg+xml;base64,';
  let zoomIn = 'data:image/svg+xml;base64,';
  let zoomOut = 'data:image/svg+xml;base64,';
  let myMap;
  (function mapSetter() {
    myMap = new ymaps.Map("stagimap", {
      center: smOptions.center || [58.010374, 56.229398],
      zoom: smOptions.initialZoom || 6,
      controls: []
    }, {
      searchControlProvider: 'yandex#search',
      restrictMapArea: smOptions.restrictArea,
      suppressMapOpenBlock: true,
      maxZoom: smOptions.maxZoom || 16,
      minZoom: smOptions.minZoom || 1,
    });
    myMap.action.setCorrection(function (tick) {
      let projection = myMap.options.get('projection');
      let mapSize = myMap.container.getSize();
      let tickCenter = projection.fromGlobalPixels(tick.globalPixelCenter, tick.zoom);
      let top = [tick.globalPixelCenter[0], tick.globalPixelCenter[1] - mapSize[1] / 2];
      let bot = [tick.globalPixelCenter[0], tick.globalPixelCenter[1] + mapSize[1] / 2];
      let tickTop = projection.fromGlobalPixels(top, tick.zoom);
      let tickBot = projection.fromGlobalPixels(bot, tick.zoom);
      if (tickTop[0] > 85) {
        tick.globalPixelCenter = projection.toGlobalPixels(
          [85, tickCenter[1]],
          tick.zoom
        );
        tick.globalPixelCenter = [tick.globalPixelCenter[0], tick.globalPixelCenter[1] + mapSize[1] / 2];
        tick.duration = 0;
      };
      if (tickBot[0] < -85) {
        tick.globalPixelCenter = projection.toGlobalPixels(
          [-85, tickCenter[1]],
          tick.zoom
        );
        tick.globalPixelCenter = [tick.globalPixelCenter[0], tick.globalPixelCenter[1] - mapSize[1] / 2];
        tick.duration = 0;
      };
      return tick;
    });
  })();
  ButtonLayout = ymaps.templateLayoutFactory.createClass([
    '<div title="{{data.title}}" class="ym-api-button" style="{{data.style}}">',
    '<img class="my-button__img" src="{{ data.image }}" width="100%">',
    '</div>'
  ].join(''));
  (function addZoomButtons() {
    let position = smOptions.zoom || {top: 80, left: 25};
    if (smOptions.zoomButtons) {
      let zoomInControl = new ymaps.control.Button({
            data: {
                image: smOptions.zoomButtons.inButton || zoomIn,
                title: smOptions.zoomButtons.inText || 'Приблизить',
                style: smOptions.zoomButtons.inStyle || 'width: 30px; height: 30px; border-radius: 20px 20px 0px 0px;'
            },
            options: {
                layout: ButtonLayout,
                noPlacemark: true
            }
      });
      zoomInControl.events.add('click', function () {
        if (myMap.getZoom() == 17) return;
        myMap.setZoom(myMap.getZoom() + 1);
      });
      myMap.controls.add(zoomInControl, {position: smOptions.zoomButtons.inPosition ||  {top: position.top, left: position.left}});
      let zoomOutControl = new ymaps.control.Button({
            data: {
                image: smOptions.zoomButtons.outButton || zoomOut,
                title: smOptions.zoomButtons.outText || 'Отдалить',
                style: smOptions.zoomButtons.outStyle || 'width: 30px; height: 30px; border-radius: 0px 0px 20px 20px;'
            },
            options: {
                layout: ButtonLayout,
                noPlacemark: true
            }
      });
      zoomOutControl.events.add('click', function () {
        if (myMap.getZoom() == 0) return;
        myMap.setZoom(myMap.getZoom() - 1);
      });
      myMap.controls.add(zoomOutControl, {position: smOptions.zoomButtons.outPosition ||  {top: position.top + 30, left: position.left}});
    }
  })();
  (function addGeoButton() {
    if (smOptions.geolocation) {
      let geolocationControl = new ymaps.control.GeolocationControl({
            data: {
                image: smOptions.geolocation.geoButton || urlButton,
                title: smOptions.geolocation.geoText || 'Текущее местоположение',
                style: smOptions.geolocation.geoStyle || ''
            },
            options: {
                layout: ButtonLayout,
                noPlacemark: true
            }
      });
      let locationPlacemark;
      geolocationControl.events.add('locationchange', function (event) {
        let position = event.get('position');
        if (!locationPlacemark) {
        locationPlacemark = new ymaps.Placemark(
          position,
          {
            balloonContent: ''
          }, {
            iconLayout: 'default#image',
            iconImageHref: smOptions.geolocation.icon || iconPoint,
            iconImageSize: smOptions.geolocation.sizePoint || [47, 52],
            iconImageOffset: smOptions.geolocation.offsetPoint || [-24, -52],
            balloonPanelMaxMapArea: 0
        });
        myMap.geoObjects.add(locationPlacemark);
        }
        locationPlacemark.geometry.setCoordinates(position);
        myMap.panTo(position);
      });
      myMap.controls.add(geolocationControl, {position: smOptions.geolocation.geoPosition ||  {top: 10, left: 10}});
    };
  })();
  let section;
  (function addPoints() {
    if (smOptions.cluster === true) {
      section = new ymaps.Clusterer({
        clusterBalloonContentLayoutWidth: 400,
        clusterBalloonContentLayoutHeight: 300,
        clusterBalloonAccordionShowIcons: false,
        clusterBalloonContentLayout: 'cluster#balloonAccordion',
        clusterDisableClickZoom: true,
        clusterOpenBalloonOnClick: true,
        clusterIcons: [{
                href: iconCluster,
                size: [56, 56],
                offset: [-28, -56]
        }]
      });
    } else {
      section = myMap.geoObjects;
    };
    if (!smOptions.data) return;
    let listener = document.querySelectorAll('a[sm-point]').length != 0 ? true : false;
    for (let i = 0; i < smOptions.data.length; i++) {
      section.add(new ymaps.Placemark(
        smOptions.data[i].coordinates,
        {
          balloonContent: smOptions.data[i].html,
          clusterCaption: smOptions.data[i].title
        }, {
          iconLayout: 'default#image',
          iconImageHref: smOptions.data[i].icon || iconPlacemark,
          iconImageSize: smOptions.data[i].sizePoint || [42, 46],
          iconImageOffset: smOptions.data[i].offsetPoint || [-21, -46],
          balloonPanelMaxMapArea: 0
        }
      ));
      if (listener && document.querySelector('a[sm-point="'+i+'"]')) {
        document.querySelector('a[sm-point="'+i+'"]').addEventListener('click', function(event) {
          event.stopPropagation();
          event.preventDefault();
          myMap.setZoom(12);
          myMap.panTo(smOptions.data[i].coordinates);
        });
      };
    };
    if (smOptions.cluster) {
      myMap.geoObjects.add(section);
    };
  })();
  let showPoints = document.querySelectorAll('a[sm-show]');
  for (var i = 0; i < showPoints.length; i++) {
    showPoints[i].addEventListener('click', function(event) {
      event.stopPropagation();
      event.preventDefault();
      myMap.geoObjects.remove(section);
      let target = event.target;
      let prop = target.getAttribute('sm-show');
      if (smOptions.cluster) {
        section = new ymaps.Clusterer({
          clusterBalloonContentLayoutWidth: 400,
          clusterBalloonContentLayoutHeight: 300,
          clusterBalloonAccordionShowIcons: false,
          clusterBalloonContentLayout: 'cluster#balloonAccordion',
          clusterDisableClickZoom: true,
          clusterOpenBalloonOnClick: true,
          clusterIcons: [{
                  href: iconCluster,
                  size: [56, 56],
                  offset: [-28, -56]
          }]
        });
      } else {
        section = myMap.geoObjects;
      };
      if (!smOptions.data) return;
      if (prop == '') {
        for (let i = 0; i < smOptions.data.length; i++) {
          section.add(new ymaps.Placemark(
            smOptions.data[i].coordinates,
            {
              balloonContent: smOptions.data[i].html,
              clusterCaption: smOptions.data[i].title
            }, {
              iconLayout: 'default#image',
              iconImageHref: smOptions.data[i].icon || iconPlacemark,
              iconImageSize: smOptions.data[i].sizePoint || [42, 46],
              iconImageOffset: smOptions.data[i].offsetPoint || [-21, -46],
              balloonPanelMaxMapArea: 0
            }
          ));
        };
      } else {
        for (let i = 0; i < smOptions.data.length; i++) {
          if (prop == smOptions.data[i].group) {
            section.add(new ymaps.Placemark(
              smOptions.data[i].coordinates,
              {
                balloonContent: smOptions.data[i].html,
                clusterCaption: smOptions.data[i].title
              }, {
                iconLayout: 'default#image',
                iconImageHref: smOptions.data[i].icon || iconPlacemark,
                iconImageSize: smOptions.data[i].sizePoint || [42, 46],
                iconImageOffset: smOptions.data[i].offsetPoint || [-21, -46],
                balloonPanelMaxMapArea: 0
              }
            ));
          };
        };
      };
      if (smOptions.cluster) {
        myMap.geoObjects.add(section);
      };
    });
  };
  (function routeBuilder() {
    if (smOptions.router) {
      let multiRoute = new ymaps.multiRouter.MultiRoute({
        referencePoints:[smOptions.router.startPoint,smOptions.router.endPoint],
        params:{
          results: smOptions.router.maxWays || 2
        }
      },{
        boundsAutoApply:true
      });
      myMap.geoObjects.add(multiRoute);
      let referencePoints = multiRoute.model.getReferencePoints();
      if (smOptions.router.refPoints) {
        let refPoints = smOptions.router.refPoints;
        for (let i = 0; i < refPoints.length; i++) {
          referencePoints.splice(-1, 0, [refPoints[i][0], refPoints[i][1]]);
          multiRoute.model.setReferencePoints(referencePoints, [1]);
        };
      };
    };
  })();
  (function showTraffic() {
    if (smOptions.traffic === true) {
      new ymaps.traffic.provider.Actual({}, { infoLayerShown: true }).setMap(myMap);
    };
  })();
  (function generateCSS() {
    let ver = '.'+document.getElementById('stagimap').children[0].getAttribute('class').slice(0, -4);
    let styles = document.createElement('style')
    styles.innerHTML = '.ym-api-button {width: 60px; height: 60px; border-radius: 30px; box-shadow: 0 2px 6px 0 rgba(0,0,0,.2); border-box; cursor: pointer; overflow: hidden;}';
    styles.innerHTML +=ver+'-default-cluster {font-weight: bold; color: ffffff; font-size: 16px;}';
    document.body.appendChild(styles);
  })();
  let movelinks = document.querySelectorAll('a[sm-move]');
  for (let i = 0; i < movelinks.length; i++) {
    movelinks[i].addEventListener('click', function(event) {
      event.stopPropagation();
      event.preventDefault();
      let element = event.target;
      let coordinates = element.getAttribute('sm-move').split(',');
      coordinates[0] = Number(coordinates[0]);
      coordinates[1] = Number(coordinates[1]);
      if (isNaN(coordinates[0]) || isNaN(coordinates[1])) {
        return console.error('"' + element.getAttribute('sm-move') + '" are not correct params at "sm-move" attribute');
      };
      myMap.setZoom(12);
      myMap.panTo(coordinates);
    });
  };
  ymaps.layout.storage.add();
};
window.onload = function() {
  ymaps.ready(init);
};

